  input: TEXT,SA11A1,SA11A1.29316.0,"On October 7, 2004 we received a contribution
    from Don Foertsch's in the amount of $5,000 which was depoisted into our federal
    account.  Two thousand five hundred dollars was transferred to our non-federal
    account on 10/7/04 which can accept unlimited contributions from individuals.  A
    letter was sent to Don Foertsch on the date his check was received to advise him
    of how his deposit was split into our accounts and to offer him a chance for a
    refund.  According to AO 2001-17, the Commission has deemed it sufficient to deposit
    checks exceeding the federal limits into a federal account and then to make a
    transfer to the nonfederal account of the portion that exceeds the federal limit.  Therefore,
    the year to date aggregate totals reported for Don Foertsch on our report is a
    reflection of the federal portion of the donor's contribution total to date."
